import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import './App.css';
import "primereact/resources/themes/saga-orange/theme.css";
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { Author } from './Components/Authors/Author';
import { Book } from './Components/Books/Book';
import { Student } from './Components/Students/Student';
import { Loan } from './Components/Loans/Loan'; // Importa el componente Loan

ReactDOM.render(
  <Router>
    <div>
      <h1 style={{ textAlign: 'center' }}>Biblioteca Alejandro Segovia</h1>
    </div>
    <Routes>
      <Route path="http://localhost:8080/author" element={<Author />} />
      <Route path="/book" element={<Book />} />
      <Route path="http://localhost:8080/student" element={<Student />} />
      <Route path="/loan" element={<Loan />} />
    </Routes>
  </Router>,
  document.getElementById('root')
);
